CREATE DEFINER=`root`@`localhost` FUNCTION `BuscarJugadoresPorNombre`(nombreBuscado VARCHAR(255)) RETURNS text CHARSET utf8mb4
    NO SQL
    DETERMINISTIC
BEGIN
    DECLARE resultado TEXT;
    
    SELECT GROUP_CONCAT(full_name) INTO resultado
    FROM datos_de_jugadores
    WHERE full_name LIKE CONCAT('%', nombreBuscado, '%');
    
    IF resultado IS NULL THEN
        SET resultado = 'No se encontraron jugadores con ese nombre.';
    END IF;
    
    RETURN resultado;
END ;;
